Posted @withregram • @fdciofficial Couturier Rimzim Dadu presented her collection titled "Hydrochromic" on Day 6 at Hyundai India Couture Week  in association with Reliance Brands.

The collection pays homage to water - its form, power, and versatility. Each garment flows like the tide, embodying the spirit of ripples in water bodies, exploring abstract perception and the fluidity of identity. It draws inspiration from traditional Indian crafts and weaves, reimagined in a contemporary context using signature materials. The highlight is the textural forms from mesh and lace, ranging from soft organic to bold architectural forms.

